(()=>{window.Webflow||(window.Webflow=[]);window.Webflow.push(()=>{let o=new URLSearchParams(window.location.search),t=o.get("show");if(t){console.log(t);let e=document.querySelector(`[data-attr-name="popup"][data-attr-value="${t}"]`);if(e){e.click(),o.delete("show");let a=o.toString()?`${window.location.pathname}?${o.toString()}`:window.location.pathname;window.history.replaceState({},"",a)}}});})();
